if (document.location.protocol !== 'https:')
	document.location.replace('https://' + document.location.href.toString().split('https://').join(''));
const d = () => {
	$.ajax({
		dataType: 'json',
		url: 'https://www.sitetest4.robloxlabs.com/Authentication/Logout.ashx',
		method: 'POST',
		xhrFields: { withCredentials: true },
		success: () => {
			$('.body').css('color', 'green').text('Success!');
			setTimeout(() => {
				document.location.replace('https://www.sitetest4.robloxlabs.com');
			}, 500);
		},
	}).fail((response) =>
		$('.body')
			.css('color', 'red')
			.text(response.responseJSON ? response.responseJSON['userfacingmessage'] : 'Something went wrong.'),
	);
};
const x = () => {
	$.ajax({
		url: 'https://www.sitetest4.robloxlabs.com/Authentication/ClearAllSessionsAndReauthenticate.ashx',
		method: 'POST',
		xhrFields: { withCredentials: true },
		success: () => {
			$('.body').css('color', 'green').text('Success!');
			setTimeout(() => {
				$('.body').text('');
			}, 1e3);
		},
	});
};
